import React from "react";
import '../assets/styles/Main.scss';

// Image paths
const image1 = require('../assets/images/1.png');
const image2 = require('../assets/images/2.png');
const image3 = require('../assets/images/3.png');
const image4 = require('../assets/images/4.png');
const image5 = require('../assets/images/5.png');

function Main() {
  return (
    <div className="hero-section">
      <div className="hero-content-container">
        <div className="hero-text-content">
          <p className="greeting-text">Hello, I'm</p>
          <h1 className="hero-name">Shailee Patel</h1>
          <div className="hero-tags">
            <span className="tag">Software Engineer</span>
            <span className="tag-separator">•</span>
            <span className="tag">Traveler</span>
            <span className="tag-separator">•</span>
            <span className="tag">Photographer</span>
          </div>
          <p className="hero-subtitle">
            Software Engineer specializing in architecting scalable, data-driven systems where technical precision meets creative purpose. 
            Much like an F1 strategist, I thrive on uncovering the stories hidden within data to drive smarter, more impactful decisions.
          </p>
          <div className="hero-cta-group">
            <button className="cta-button-primary" onClick={() => {
              const careerSection = document.getElementById('career');
              if (careerSection) {
                careerSection.scrollIntoView({ behavior: 'smooth' });
              }
            }}>
              View My Work
            </button>
            <button className="cta-button-secondary" onClick={() => {
              window.open("https://www.linkedin.com/in/shailee-patel/", '_blank');
            }}>
              Get In Touch
            </button>
          </div>
        </div>

        <div className="hero-visual-section">
          <div className="bento-image-item item-1">
            <img src={image1} alt="Washington DC" className="bento-image" />
          </div>
          <div className="bento-image-item item-2">
            <img src={image2} alt="Denver" className="bento-image" />
          </div>
          <div className="bento-image-item item-3">
            <img src={image3} alt="Park" className="bento-image" />
          </div>
          <div className="bento-image-item item-4">
            <img src={image4} alt="Chicago" className="bento-image" />
          </div>
          <div className="bento-image-item item-5">
            <img src={image5} alt="Golden Gate" className="bento-image" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Main;
